tted-map-black-big-copy.jpg\" background_size=\"initial\" background_position=\"top_center\" min_height=\"623px\" max_height=\"623px\"][et_pb_row column_structure=\"3_5,2_5\" _builder_version=\"4.4.8\" module_alignment=\"center\" custom_margin=\"||||false|false\" custom_padding=\"|||70px|false|false\"][et_pb_column type=\"3_5\" _builder_version=\"4.4.8\"][et_pb_text _builder_version=\"4.4.8\" text_font=\"Poppins|300|||||||\" text_text_color=\"#FFFFFF\" text_font_size=\"16px\" header_3_font=\"Poppins|600|||||||\" header_3_font_size=\"36px\" background_layout=\"dark\" custom_margin=\"90px|||3px|false|false\"]<h3 style=\"text-align: center;\">Work at SIO</h3>\n<p style=\"text-align: center;\">While we strive to grow as a business, we also strive to give back to the world. SIO is implementing a socially conscious program to provide transportation to those in developing countries who cannot afford it. Please stay tuned for updates.</p>\n<p style=\"text-align: center;\">Our customers can sign up to become sponsors for certain projects, and SIO will do the leg work while provide video footage of help being provided to those in need, on our customers behalf.</p>[/et_pb_text][/et_pb_column][et_pb_column type=\"2_5\" _builder_version=\"4.4.8\"][/et_pb_column][/et_pb_row][/et_pb_section]', 'Home', '', 'inherit', 'closed', 'closed', '', '35-revision-v1', '', '', '2020-07-14 19:56:35', '2020-07-14 19:56:35', '', 35, 'http://localhost/sionow/index.php/2020/07/14/35-revision-v1/', 0, 'revision', '', 0),
