: center;\">Our customers can sign up to become sponsors for certain projects, and SIO will do the leg work while provide video footage of help being provided to those in need, on our customers behalf.</p>[/et_pb_text][/et_pb_column][/et_pb_row][/et_pb_section]', 'Home', '', 'inherit', 'closed', 'closed', '', '35-revision-v1', '', '', '2020-08-06 10:44:05', '2020-08-06 10:44:05', '', 35, 'http://localhost/sionow/35-revision-v1/', 0, 'revision', '', 0),
