(74, 1600081158, 1600081158, 'new', 'skippedPaths', 25, '6fd0d290b978eab8027e6b79501ac149', '6fd0d290b978eab8027e6b79501ac149', '2 paths were skipped for the malware scan due to scan settings', 'The option \"Scan files outside your WordPress installation\" is off by default, which means 2 paths and their file(s) will not be scanned for malware or unauthorized changes. To continue skipping these paths, you may ignore this issue. Or to start scanning them, enable the option and subsequent scans will include them. Some paths may not be necessary to scan, so this is optional. <a href=\"https://www.wordfence.com/help/?query=scan-result-skipped-paths\" target=\"_blank\" rel=\"noopener noreferrer\">Learn More</a><br><br>The paths skipped are ~/.quarantine and ~/.tmb', 'a:0:{}');
